        $(document).ready(function() {
			
        $('#fullpage').fullpage({
			anchors: ['home', 'lpi', 'work', 'partner', 'team', 'story','contact'],
			menu: '#menu',
			css3: false,
			scrollOverflow: true,
			scrollingSpeed: 1250,
			touchSensitivity: 10,
			normalScrollElements: '.modal'
        });
		
        $('#front_btn').click(function() {
			$('#back').show();
			$('#front').hide();
        });

        $('#front1_btn').click(function() {
			$('#back1').show();
			$('#front1').hide();
        });


        $('#back_btn').click(function() {
        $('#back').hide();
        $('#front').show();
        });

        $('#back1_btn').click(function() {
			$('#back1').hide();
			$('#front1').show();
        });
        
        $('#front2_btn').click(function() {
			$('#back1').hide();
			$('#back2').show();
			$('#front1').hide();
        });
        $('#back2_btn').click(function() {
			$('#back2').hide();
			$('#front1').show();
			$('#front2').show();
        });

        });



            